INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760242000035', 'Tajine de poulet aux fruits secs et pois chiches', 'Filet de poulet jaune 27% (origine UE}. pois chiches 15%. carottes 10%, oignons 8%. tomates confites 7% [tomates semi-déshydratées assaisonnées à i‘ail et aux herbes, huile de colza, ail. sel, basilic. thym. origan. sucre. conservateur : sorbate de sodium (E202), antioxydants : acide citrique  (E330), lactate de potassium (E326). citron confit 3% (citrons, eau, sel. acide citrique}, fond brun   3% [amidon de pomme de terre, farine de blé, sel, légumes (oignon grillé, purée de tomates), arômes (dont blé, orge), maltodextrine, sucre extrait de levure. colorant (caramel E150c). acidiﬁant (acide citrique), poivre . extrait de viande de bœuf 0,06%], raisins secs 3% {huile végétale  conservateur E220 (anhydride sulfureux). amandes 3%, huile d\'olive 3%   olives vertes 2% [olives vertes. sel. acidiﬁant (acide citrique acide lactique), antioxydant : acide ascorbique]. eau de ﬂeur d\'oranger (eau, extrait de fleur d\'oranger (huile essentielle de Néroli), arôme) ail, bouillon de volaille (sel, sirop de glucose, volaille, graisse de poulet, viande de poule, extrait de levure, oignon, ail, curcuma, arômes, blé, oeuf, caramel, sucre, eau, acidifiant : acide citrique, poivre, extrait de céleri, antioxygènes : BHA, gallate de propyle, épices raz el hanout mélange d\'épices : coriandre, curcuma, fenouil, fenugrec, romarin, coriandre, persil, sel, poivre.', 'https://static.openfoodfacts.org/images/products/376/024/200/0035/front_fr.13.400.jpg', '7.4', '0.7', '12.4', '7.7', '9.4', '8.5', '0.62', '0.244094488188976', '', '1');

