VALUES ('3760242000042', 'Risotto aux légumes du soleil et basilic thaï', 'Risotto 43% [riz 90%, échalote 4%, huile d\'olive 3%, bouillon de légumes 2% [sel, amidon (pomme de terre, pois), extrait de levure, sucre, légumes 4,8% (oignon, _céleri_, chou-fleur), jus de légumes concentrés 2,6% (carotte, _céleri_, oignon, poireau), huile d\'olive vierge extra, épices et aromates (persil, ail, poivre, laurier, curcuma), maltodextrine, arômes, huile de tournesol, sel], courgette 18%, aubergine 12%, crème fraîche 8% [_crème_, stabilisant : carraghénanes], poivron rouge et poivron vert 5%, parmesan 2% (_lait_ cru de vache, sel, présure), tomates confites 2% [tomates semi-déshydratées assaisonnées à l\'ail et aux herbes, huile de colza, ail, sel, basilic, thym, origan, sucre, conservateur : sorbate de sodium (E202), antioxydants : acide citrique (E330), lactate de potassium (E326), atmosphère protectrice N2/C02), basilic 0,6%, bouillon de légumes [sel, amidon (pomme de terre, pois), extrait de levure, sucre, légumes 4,8% (oignons, _céleri_, chou-fleur), jus de légumes concentrés 2,6% (carottes, _céleri_, oignon, poireau), huile d\'olive vierge extra, épices et aromates (persil, ail, poivre, laurier, curcuma), maltodextrine, arômes, huile de tournesol], huile d\'olive, ail, sel, poivre noir.', 'https://static.openfoodfacts.org/images/products/376/024/200/0042/front_fr.12.400.jpg', '5.6', '2.4', '32.2', '3.6', '6.6', '4.4', '0.6', '0.236220472440945', '', '1');

